import './index.scss';
import {Animator, batch, Fade, FadeOut, ScrollContainer, ScrollPage, Sticky, Zoom} from 'react-scroll-motion';

function SkillsCertificates(){
  return (
    <html>
    <ScrollContainer>
      <ScrollPage page = {0}>
        <Animator animation = {batch(Sticky(), FadeOut())}>
          <h2>Let me show you a scroll animation</h2>
        </Animator>
      </ScrollPage>
      <ScrollPage page = {1}>
        <Animator animation = {Zoom()}>
          <h4>I'm Fade Up Scroll Out !</h4>
        </Animator>
      </ScrollPage>
    </ScrollContainer>
    </html>
  );

}
export default SkillsCertificates;
